import React from "react"; // Import React to use JSX
import ReactDOM from "react-dom"; // Import ReactDOM to render the components into the DOM
import app from "./app"; // Import your app component (note the lowercase "a")
import "./App.css"; // Import your CSS file for styling

ReactDOM.render(
  <React.StrictMode>
    <app /> {/* This renders the app component */}
  </React.StrictMode>,
  document.getElementById("root") // This will insert the app into the div with id="root" in your index.html
);
